import Cookie from "js-cookie"
import React from "react"
import { useHistory } from "react-router-dom"

export default function(Component) {
  function auth(props) {
    //   const history = useHistory()
    if (!Cookie.get("token")) {
      return
    }
  }

  return auth
}
